window.bookSummaryJSON = "<p><b>Bursting with laughter, romance, and magic, the Audible and </b><b><i>USA Today</i></b><b> best-selling Starfall Point trilogy comes to an epic finale that will leave you enchanted!</b></p> <p>Alice Seastairs leads a quiet life working in her grandparents’ antique shop and hiding her magical secret from the human world. As one of Starfall Point’s resident witches, it’s her job to protect the Island from dark magic and unruly ghosts—including the ones that show up at her shop attached to antiques. But her orderly life is turned upside down when a gorgeous stranger buys the islands most historic—and haunted—hotel.</p> <p>There’s something about Collin Bancroft that that makes Alice want to muss his polished exterior and find out what’s underneath his expensive suit. But romance will have to wait, because his hotel is being haunted by a ghost so dangerous that Alice’s whole coven must step in. Turns out, a supernatural event is unfolding that’s bigger than any of them ever imagined—and it’s about to blow the secrets of Shaddow House wide open. Will Alice and Collin survive long enough to have a future together?</p>"; 
